Teacher are not just humans who serve the purpose to teach us; they are the backbone of the youth of this country. Today we want to thank all the teachers for guiding us, motivating us, loving us and being our pillars of support in every phase of our life.

YRC KIIT wishes a very Happy Teacher's Day to all the teachers out there!!

From teaching to mentoring , from scolding to loving , from seeing us fall to providing a helping hand to lift us up, teachers stand with us in every thick and thin of our lives. This day marks the birthday of  Dr Radhakrishan, the first Vice President and the second President of our independent India and we celebrate his birth anniversary in the form of Teacher's Day. It is the mentorship and the guidance of teachers that we have such successful people throughout the world. Words are not enough to describe the selfless guidance and love which we get from the teachers throughout our lives.
Though this pandemic has not given us less problems and hurdles, but taking the education to a next level and not compromising with the career of students, the teachers have surely been a ray of hope for all of us. Times are challenging for us but the teachers have been our lockdown mentor.Dear teachers, you are no less than our parents.
